import {useState,useEffect} from 'react';
import Layout from "../components/Layout";
import Search from '../components/blog/Search';
import Link from 'next/link';
import homeCard from '../components/home/homeCard';
import {getCategories} from '../actions/category';

const Index = ()=>{

    const [loadCategories,getCategories]=useState([]);


    const loadFunc=()=>{

        getCategories().then(data=>{
            if (data && data.error) {
                console.log(data.error);
            } else {
                getCategories(data);
                console.log('loadCategories',loadCategories);
            }
        })
    }

    useEffect(()=>{
        loadFunc();
    },[])

    return(
        <Layout>
            {/* <h2>Index page</h2>
            <Link href="/signup">
            <a>Signup</a>
            </Link>
            */}

        <div className="banner">
				<div className="container">
					
					<h2>I'm Banner Heading for This Page</h2>
					
					<p>It is our belief that in order to be most efficient it requires adaptive technology and software our customers can focus on their core business.</p>
				</div>
			</div>
            <Search/>
        </Layout>

        



    )
}


export default Index;
